import React from 'react';
import './Suggestions.css'
import {Avatar} from "@material-ui/core";

function Suggestions() {
  return (
    <div>
        <div>
            <div>
                <div>Suggestions For You</div>
            </div>
            <div>
                <div>
                    <Avatar src={imageSrc} />
                    <div>Friend </div>
                </div>
            </div>
        </div>
    </div>
  );
};

export default Suggestions;
